CREATE DATABASE IF NOT EXISTS check;

USE check;

DROP TABLE IF EXISTS area;

CREATE TABLE `area` (
  `id_area` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `n_area` int(10) unsigned NOT NULL,
  `d_area` text NOT NULL,
  `nomen_area` text NOT NULL,
  PRIMARY KEY (`id_area`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS config;

CREATE TABLE `config` (
  `id_config` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `config_descr` text NOT NULL,
  `valor` text NOT NULL,
  `clave` text NOT NULL,
  PRIMARY KEY (`id_config`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS estado;

CREATE TABLE `estado` (
  `id_estado` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `d_estado` text NOT NULL,
  PRIMARY KEY (`id_estado`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS fichaje;

CREATE TABLE `fichaje` (
  `id_fichaje` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `id_usuario` int(10) unsigned NOT NULL,
  `fecha` date NOT NULL,
  `hentrada` time DEFAULT NULL,
  `hsalida` time DEFAULT NULL,
  `just_entrada` text NOT NULL,
  `just_salida` text NOT NULL,
  PRIMARY KEY (`id_fichaje`)
) ENGINE=InnoDB AUTO_INCREMENT=1644 DEFAULT CHARSET=latin1;

