DROP TABLE IF EXISTS hoja;

CREATE TABLE `hoja` (
  `id_hoja` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `fdp` date NOT NULL,
  `estado` text NOT NULL,
  `id_usuario` int(10) unsigned NOT NULL,
  `horacierre` time NOT NULL,
  PRIMARY KEY (`id_hoja`)
) ENGINE=InnoDB AUTO_INCREMENT=389 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS log_diario;

CREATE TABLE `log_diario` (
  `id_tarea` int(10) unsigned NOT NULL,
  `id_hoja` int(10) unsigned NOT NULL,
  `id_usuario` int(10) unsigned NOT NULL,
  `hora` time NOT NULL,
  `valor` longtext NOT NULL,
  `estado` smallint(1) NOT NULL,
  `turno` text NOT NULL,
  PRIMARY KEY (`id_tarea`,`id_hoja`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

