DROP TABLE IF EXISTS log_diario_mov;

CREATE TABLE `log_diario_mov` (
  `id_tarea` int(10) unsigned NOT NULL,
  `id_mov` int(10) unsigned NOT NULL,
  `id_usuario` int(10) unsigned NOT NULL,
  `hora` time NOT NULL,
  `valor` text NOT NULL,
  `guardado` text NOT NULL,
  `estado` int(11) NOT NULL,
  PRIMARY KEY (`id_tarea`,`id_mov`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS movimiento_fecha;

CREATE TABLE `movimiento_fecha` (
  `id_mov` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `id_usuario` int(10) unsigned NOT NULL,
  `id_area` int(10) unsigned NOT NULL,
  `fecha_mov` date NOT NULL,
  `mov_d` text NOT NULL,
  `fecha_act` date NOT NULL,
  `hora` time NOT NULL,
  `estado` text NOT NULL,
  `f_cierre` datetime NOT NULL,
  `user_cierre` text NOT NULL,
  PRIMARY KEY (`id_mov`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS nivel;

CREATE TABLE `nivel` (
  `id_nivel` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `d_nivel` text NOT NULL,
  `d_numero` int(11) NOT NULL,
  PRIMARY KEY (`id_nivel`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS reproceso;

CREATE TABLE `reproceso` (
  `fdp` date NOT NULL,
  `id_usuario` int(10) unsigned NOT NULL,
  `estado` text NOT NULL,
  `fecha_actual` datetime NOT NULL,
  `super` text NOT NULL,
  PRIMARY KEY (`fdp`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS reproceso_tareas;

CREATE TABLE `reproceso_tareas` (
  `id_reproceso` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `id_tarea` int(10) unsigned NOT NULL,
  `fdp` date NOT NULL,
  `id_usuario` int(10) unsigned NOT NULL,
  `hora` time NOT NULL,
  `valor` text NOT NULL,
  PRIMARY KEY (`id_reproceso`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS seguimiento;

CREATE TABLE `seguimiento` (
  `id_seguimiento` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `id_usuario` int(10) unsigned NOT NULL,
  `tarea` text NOT NULL,
  `fecha` datetime NOT NULL,
  `accion` text NOT NULL,
  PRIMARY KEY (`id_seguimiento`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tareas;

CREATE TABLE `tareas` (
  `id_tarea` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `n_tarea` text NOT NULL,
  `d_tarea` text NOT NULL,
  PRIMARY KEY (`id_tarea`)
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS turnos;

CREATE TABLE `turnos` (
  `id_hoja` int(10) unsigned NOT NULL,
  `id_usuario` int(10) unsigned NOT NULL,
  `testado` text NOT NULL,
  PRIMARY KEY (`id_hoja`,`id_usuario`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS usuario;

CREATE TABLE `usuario` (
  `id_usuario` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nombre` text NOT NULL,
  `apellido` text NOT NULL,
  `email` text NOT NULL,
  `nivel` int(10) unsigned NOT NULL,
  `legajo` text NOT NULL,
  `usuario` text NOT NULL,
  `pass` text NOT NULL,
  PRIMARY KEY (`id_usuario`),
  KEY `nivel` (`nivel`),
  CONSTRAINT `usuario_ibfk_1` FOREIGN KEY (`nivel`) REFERENCES `nivel` (`id_nivel`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;




